import styled from "styled-components";

export const Box = styled.div`
    border: 1px solid black;
    border-radius: 3px;
    margin: 10px 0px;
    box-sizing: border-box;
    width: 140px;
    padding: 7px;
    cursor: default;
    display: flex-box;
    justify-content: center;
 
`

export const Button = styled.span`

    display: inline-block;
    color: black;
    text-align: center;
    width: 33%;
    margin: auto; 
    font-size: 1.2rem;
}

    `
